export default {
	disableCreateShipment: () => {
		if (GetOrderDetail.data.data.getOrder.shipments[ListShipmentDetail.selectedRowIndex].transportCompanyShipmentId != ""){
			if (GetOrderDetail.data.data.getOrder.shipments[ListShipmentDetail.selectedRowIndex].transportCompanyShipmentId == null) {
				return false
			}
			return true
		}
		return false
	},
	disablePrintLabel: () => {
		if (GetOrderDetail.data.data.getOrder.shipments[ListShipmentDetail.selectedRowIndex].transportCompanyShipmentId == ""){
				return true
		}
		for (let i = 0; i < GetOrderDetail.data.data.getOrder.shipments[ListShipmentDetail.selectedRowIndex].items.length; i ++) {
			if (GetOrderDetail.data.data.getOrder.shipments[ListShipmentDetail.selectedRowIndex].items[i].transportCompanyItemId != "") {
				if (GetOrderDetail.data.data.getOrder.shipments[ListShipmentDetail.selectedRowIndex].items[i].transportCompanyItemId == null) {
					return true
				}
				return false
			}
		}
		return true
	},
	deliverableShipments: () => {
		var ret = []

		for (let i = 0; i < GetOrderDetail.data.data.getOrder.shipments.length; i ++) { 

			//find deliverable shipments
			if (GetOrderDetail.data.data.getOrder.shipments[i].transportCompanyShipmentId != ""){
				if (GetOrderDetail.data.data.getOrder.shipments[i].transportCompanyShipmentId != null){
					if (GetOrderDetail.data.data.getOrder.shipments[i].status == "PACKED") {
						var items = []
						//find deliverable shipment items
						for (let j = 0; j < GetOrderDetail.data.data.getOrder.shipments[i].items.length; j ++) {
							if (GetOrderDetail.data.data.getOrder.shipments[i].items[j].transportCompanyItemId != "") {
								if (GetOrderDetail.data.data.getOrder.shipments[i].items[j].transportCompanyItemId != null) {
									let item = {
										"id": GetOrderDetail.data.data.getOrder.shipments[i].items[j].id,
										"transportCompanyShipmentId": GetOrderDetail.data.data.getOrder.shipments[i].items[j].transportCompanyItemId
									}
									items.push(item)
								}
							}
						}
						let shipment = {
							"id": GetOrderDetail.data.data.getOrder.shipments[i].id,
							"transportCompanyShipmentId": GetOrderDetail.data.data.getOrder.shipments[i].transportCompanyShipmentId,
							"items": items
						}
						ret.push(shipment)
					}

				}
			}
		}
		return ret
	}
}
